●安全靴とは思えないスマートなデザインで、幅広い年代層に大人気！<br><br>

●スポーツシューズのような快適さとフィット感が、長時間の作業をサポート！<br><br>

●小さいサイズ展開もあり、女性にもお求めいただけます！<br><br><br>

【安全性】<br>
・JIS T8101 L種相当の軽くそのまま廃棄できる樹脂製先芯を採用。<br>
・夜間の作業でも安全性を高める再帰反射材を採用。<br><br>

【クッション性】<br>
・JIS T8101E相当。<br>
・衝撃緩衝材αGELを搭載。<br>
・成型E.V.A.(合成樹脂製スポンジ)ミッドソールを採用。<br><br>

【グリップ性】<br>
・JIS T8101F相当。<br>
・高グリップ性能意匠ソールを装着し、油の床でもグリップ性を発揮。<br><br>

【フィット性】<br>
・3Eラストを採用。<br>
・疲れにくいSRB中敷きを採用。<br><br>

【耐久性】<br>
・耐油ラバー底を採用。<br><br>

【屈曲性】<br>
・アウターソール及びミッドソールに屈曲溝を付け、歩きに適した柔軟性を確保。<br><br>

【通気性】<br>
・通気性に優れたダブルラッセルメッシュ素材を採用。<br><br>

【その他】<br>
・白ラバー底はフロアーの汚れを軽減。<br><br><br>


■規格：  JSAA B種<br>
■材質(アッパー)：  (本体)合成繊維製、(補強)人工皮革製<br>
■材質(ソール)：  ゴム底<br>
■標準質量(g/片足)：  約380(26.5cm)<br>
■インナー：  取り替え式<br>
■足幅：  3E<br>
■材質(先芯)：  強化ガラス繊維入り樹脂製<br>
■内容量：1足 <br><br><br> 


