【お詫び】誠に申しわけありませんが、27.0cm以外 現在メーカー欠品中です。<br><br>

同じく アシックス ウィンジョブの５１Sでしたら、ご用意できます。<br><br>


●安全靴とは思えないスマートなデザインで、幅広い年代層に大人気！<br><br>

●スポーツシューズのような快適さとフィット感が、長時間の作業をサポート！<br><br>

●小さいサイズ展開もあり、女性にもお求めいただけます！<br><br><br>



・プロスニーカーA種認定品<br>
・JSAA（日本保安用品協会）認定合格<br>
・プロテクティブスニーカー規格認定合格<br><br>


■安全性（A種先芯入り [JIS規格 S種相当品]）<br>
爪先には強化ガラス繊維入り樹脂製の軽量先芯を使用。<br>
また、夜間の屋外作業の安全配慮として、暗い所でも光に反射する再帰反射材を採用。<br><br>

■耐久性<br>
アウターソールには油に劣化しにくい耐油ラバーを使用し、<br>
痛みやすい爪先にはラバーで補強を施して耐久性をぐんと向上。<br><br>

■グリップ性<br>
油で汚れた床でもスリップしにくい高グリップ性能のアウターソールを採用。<br>
その耐滑性能はJSAA規格認定（動摩擦係数0.20以上)を受けています。<br><br>

■クッション性<br>
スポーツシューズに於ける衝撃緩衝材の代名詞ともされる『αGEL（アルファゲル）』を<br>
最も体重の掛かりやすい踵部に搭載する事で、足への衝撃を和らげて負担を軽減。<br>
また、クッション性と軽量性に優れたE.V.A.（合成樹脂製スポンジ）ミッドソールを採用する事で、<br>
快適な履き心地を実現。<br><br>

■フィット性<br>
足の負担を軽減する為に、足のアーチを支えて踵の内側への倒れ込みを抑える立体形状の『SRB中敷』を採用。<br>
取り替え式で洗濯も可能なので、清潔感を保ちます。<br><br>

■屈曲性<br>
作業用靴のアウターソールとミッドソールに足の動きに合わせた屈曲溝を設け、<br>
自然な動きを妨げない履き心地を実現。<br><br>

【商品仕様】<br>
・型番：FIS53S　<br>
・材質：[アッパー] 人工皮革製 ／ [補強] 人工皮革製 ／ [表底] ゴム底<br>
・ウィズ：3E<br>
・インソール：取り替え式<br>
