土踏まず周辺は、キュッとすこし狭め。圧迫感を感じない程度のホールド感。<br>
そしてつま先は、ゆったり広め。<br><br>

●スポーツシューズのような快適さとフィット感が、長時間の作業をサポート！<br><br>

●小さいサイズ展開もあり、女性にもお求めいただけます！<br><br>

●JIS T8101 L種相当の軽くそのまま廃棄できる樹脂製先芯を採用。<br><br>

●夜間の作業でも安全性を高める再帰反射材を採用。<br><br>

●衝撃を和らげて、足を守るゲル入り。<br>
地上１８ｍから卵を落としても、割れないハイテク素材です。<br><br>

●つま先を衝撃から守ります。<br>
JIS規格L級に相当するJSAAのB種に合格した先芯で、つま先を衝撃から守ります。<br><br><br>


【クッション性】<br>
・JIS T8101E相当。
