・成型E.V.A.(合成樹脂製スポンジ)ミッドソールを採用。<br>
⇒優れたクッション性、衝撃緩衝性、軽量性を兼ね備えています。<br><br>

【グリップ性】<br>
・JIS T8101F相当。<br>
・高グリップ性能意匠ソールを装着し、油の床でもグリップ性を発揮。<br><br>

【フィット性】<br>
・3Eラストを採用。<br>
・疲れにくいSRB中敷きを採用。<br><br>

【耐久性】<br>
・耐油ラバー底を採用。<br><br>

【屈曲性】<br>
・アウターソール及びミッドソールに屈曲溝を付け、歩きに適した柔軟性を確保。<br><br>

【通気性】<br>
・通気性に優れたダブルラッセルメッシュ素材を採用。<br><br>

■規格：JSAA B種   <br>
■材質(アッパー)：(本体)合成繊維製、(補強)人工皮革製 <br>
■材質(ソール)：ゴム底 <br>
■標準質量(g/片足)：  約380(26.5cm)<br>
■インナー：取り替え式<br>
■足幅：3E<br>
